  {"name": "u_fov", "label": "FOV", "type": "float", "default": 1.5, "min": 0.5, "max": 3.0},
  {"name": "u_complexity", "label": "Membrane Detail", "type": "float", "default": 1.0, "min": 0.0, "max": 3.0},
  {"name": "u_fold_speed", "label": "Fold Speed", "type": "float", "default": 0.2, "min": 0.0, "max": 2.0},
  {"name": "u_glow", "label": "Glow Intensity", "type": "float", "default": 0.2, "min": 0.0, "max": 1.0},
  {"name": "u_color_speed", "label": "Color Cycle Spd", "type": "float", "default": 0.2, "min": 0.0, "max": 2.0}
]
