precision highp float;
out vec4 fragColor;
uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;

uniform float u_speed;
uniform float u_camera_dist;
uniform float u_fov;
uniform float u_complexity;
uniform float u_fold_speed;
uniform float u_glow;
uniform float u_color_speed;

// --- UTILS ---
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

// 3D Noise function for organic motion
float hash(vec3 p) {
    p = fract(p * 0.3183099 + 0.1);
    p *= 17.0;
    return fract(p.x * p.y * p.z * (p.x + p.y + p.z));
}

float noise(vec3 x) {
    vec3 i = floor(x);
    vec3 f = fract(x);
    f = f * f * (3.0 - 2.0 * f);
    return mix(mix(mix(hash(i + vec3(0, 0, 0)), hash(i + vec3(1, 0, 0)), f.x),
                   mix(hash(i + vec3(0, 1, 0)), hash(i + vec3(1, 1, 0)), f.x), f.y),
               mix(mix(hash(i + vec3(0, 0, 1)), hash(i + vec3(1, 0, 1)), f.x),
                   mix(hash(i + vec3(0, 1, 1)), hash(i + vec3(1, 1, 1)), f.x), f.y), f.z);
}

// Organic path for the camera to follow
vec2 getPath(float z) {
    return vec2(
        sin(z * 0.15) * 2.5 + cos(z * 0.08) * 1.5,
        cos(z * 0.12) * 2.0 + sin(z * 0.22) * 1.0
    );
}

// --- DISTANCE FIELD ---
float map(vec3 p) {
    // Offset the coordinate space to follow the curved path
    p.xy -= getPath(p.z);

    // Create "folding" via domain repetition and rotation
    vec3 p_mem = p;
    float t = iTime * u_fold_speed;

    // Twist the space
    p_mem.xy *= rot(p.z * 0.1 + t);

    // FBM Folding
    float n = 0.0;
    float amp = 1.0;
    float freq = u_complexity;
    for(int i = 0; i < 4; i++) {
        n += noise(p_mem * freq + t) * amp;
        amp *= 0.5;
        freq *= 2.0;
    }

    // The "Membrane" (Hollow shell)
    float membrane = abs(length(p_mem.xy) - (1.5 + n * 0.8)) - 0.02;
    float filaments = length(p_mem.xy) - 0.05; // Core filament

    return min(membrane, filaments * 0.8);
}

// Normal calculation
vec3 getNormal(vec3 p) {
    vec2 e = vec2(0.01, 0);
    return normalize(vec3(
        map(p + e.xyy) - map(p - e.xyy),
        map(p + e.yxy) - map(p - e.yxy),
        map(p + e.yyx) - map(p - e.yyx)
    ));
}

void mainImage( out vec4 fragColor, in vec2 fragCoord ) {
    vec2 uv = (fragCoord - 0.5 * iResolution.xy) / iResolution.y;

    float t = iTime * u_speed;

    // --- CAMERA FIX: FRENET FRAME NAVIGATION ---

    // 1. Current Center of Tunnel
    vec3 pCenter = vec3(0.0, 0.0, t);
    pCenter.xy += getPath(pCenter.z);

    // 2. Future Center (Lookahead)
    vec3 pNext = vec3(0.0, 0.0, t + 0.5);
    pNext.xy += getPath(pNext.z);

    // 3. Compute Tangent (Forward Direction)
    vec3 fwd = normalize(pNext - pCenter);

    // 4. Compute Right and Up vectors relative to curve
    vec3 worldUp = vec3(0.0, 1.0, 0.0);
    vec3 right = normalize(cross(fwd, worldUp));
    vec3 up = cross(right, fwd);

    // 5. Apply Offset along LOCAL axes (Rotates with the tunnel!)
    // We orbit in the plane defined by Right and Up
    float angle = t * 0.1;
    vec3 offset = right * cos(angle) * u_camera_dist + up * sin(angle) * u_camera_dist;

    vec3 ro = pCenter + offset;

    // 6. Target logic
    vec3 ta = vec3(0.0, 0.0, t + 4.0);
    ta.xy += getPath(ta.z); 
    // Look slightly towards center from our offset position
    ta += offset * 0.5; 

    // --- STANDARD RENDER ---
    vec3 cw = normalize(ta - ro);
    vec3 cu = normalize(cross(cw, vec3(0, 1, 0)));
    vec3 cv = normalize(cross(cu, cw));
    vec3 rd = normalize(uv.x * cu + uv.y * cv + cw * u_fov);

    float d = 0.0;
    float total_d = 0.0;
    float glow = 0.0;

    // Raymarch
    // Reduced step count slightly for performance loop
    for(int i = 0; i < 80; i++) {
        vec3 p = ro + rd * total_d;
        d = map(p);

        glow += exp(-d * 4.0) * u_glow;

        if(d < 0.001 || total_d > 40.0) break;
        total_d += d * 0.6;
    }

    vec3 col = vec3(0.0);

    if(total_d < 40.0) {
        vec3 p = ro + rd * total_d;
        vec3 norm = getNormal(p);

        // Colors
        vec3 color_a = vec3(0.1, 0.8, 0.9); // Cyan
        vec3 color_b = vec3(0.6, 0.1, 0.8); // Purple

        // Smooth Color Mix
        vec3 bio_color = mix(color_a, color_b, sin(p.z * 0.2 + iTime * u_color_speed) * 0.5 + 0.5);

        float diff = max(dot(norm, -rd), 0.0);
        float fresnel = pow(1.0 - diff, 4.0);
        col = bio_color * diff + fresnel * vec3(1.0);
    }

    // Glow
    vec3 glowCol = vec3(0.1, 0.6, 1.0) * mix(vec3(1.0), vec3(0.5,0.0,1.0), sin(t)*0.5+0.5);
    col += glowCol * glow * 0.15;

    col *= exp(-0.08 * total_d); // Fog

    col = pow(col, vec3(1.1));
    col = smoothstep(0.0, 1.0, col);

    fragColor = vec4(col, 1.0);
}

void main() {
    mainImage(fragColor, gl_FragCoord.xy);
}
